import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Login.css';
import api from '../services/api';

export default function Login({ history }) {
    const [email, setEmail] = useState('');
    const [senha, setSenha] = useState('');

    function handleSubmit(e) {
        e.preventDefault();
        
        

        history.push('/profissionais');
    }


    return (
        <div className="container-principal">
            <div className="container-form">


                <form onSubmit={handleSubmit}>
                    <div className="container-form-element">
                        <label for="email">Email</label>
                        <input value={email} onChange={e => setEmail(e.target.value)} id="email" type="text" placeholder="Digite seu email"></input>
                    </div>

                    <div className="container-form-element">
                        <label for="senha">Senha</label>
                        <input senha={email} onChange={e => setSenha(e.target.value)}  id="senha" type="password" placeholder="Digite sua senha"></input>
                    </div>




                    <a href="#">Esqueci minha senha</a>

                    <p>Ainda n√£o tem uma conta?
                    <Link to="/cadastro">
                            <a> Cadastre-se aqui</a>
                        </Link>
                    </p>


                    <button type="submit">Entrar</button>

                </form>
            </div>

        </div>
    );
}
